import "./styles.css";
import React ,{Component} from 'react';
import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import Home from './home';

class App extends Component {
  render() {
  return (
    <div className="App">
      <BrowserRouter>
      <switch>
      <Routes>
        <Route exact path={"/"} component = {Home}></Route>
      </Routes>
      </switch>
      </BrowserRouter>
    </div>
  );
  }
}

export default App;
